import { Switch, Route} from 'react-router-dom'
import './App.css';
import Login from './screens/Login'

function App() {
  return (
    <Switch>
      <div className="App">
        <Route path='/'>
          <Login />
        </Route>
      </div>
    </Switch>
  );
}

export default App;
